\0[\0objectsq\0~\0xpuq\0~\0\0\0\0t\0\rANTForPluginst\0PerlForPluginsx\0q\0~\0t\00http://wiki.web-cat.org/WCWiki/SampleBatchPlugint\0$Patrick VanMetre (jpvanmetre@me.com)t\01t\0\Zhttp://web-cat.org/updatest\0>http://wiki.web-cat.org/WCWiki/SampleBatchPlugin/ChangeHistorysq\0~\0)uq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0sizet\0typet\0namet\0descriptiont\0propertyuq\0~\0\0\0\0t\020t\0	shortTextt\0MOSS User Tokent\01The authentication token used to connect to MOSS.t\0\rmossUserTokenx\0q\0~\06xq\0~\0t\0kThis batch plugin collects multiple student submissions and sends them to\r\n  MOSS for plagiarism detection.t\0\nSubmissionsq\0~\0)uq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0sizet\0propertyt\0typet\0namet\0descriptionuq\0~\0\0\0\0t\0javat\025t\0languaget\0	shortTextt\0Source Code LanguageteIndicate the programming language used in the student source files.  MOSS\r\n  currently supports the following choices: \"c\", \"cc\" (for C++), \"java\",\r\n  \"ml\", \"pascal\", \"ada\", \"lisp\", \"scheme\", \"haskell\", \"fortran\",\r\n  \"ascii\", \"vhdl\", \"perl\", \"matlab\", \"python\", \"mips\", \"prolog\",\r\n  \"spice\", \"vb\", \"csharp\", \"modula2\", \"a8086\", \"javascript\", and\r\n  \"plsql\".x\0q\0~\0Gsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0typet\0namet\0descriptiont\0propertyuq\0~\0\0\0\0t\010t\0integert\0Maximum Occurrences to Considert•This option sets the maximum number of times a given passage may appear\r\n  before it is ignored.  A passage of code that appears in many programs\r\n  is probably legitimate sharing and not the result of plagiarism.  By\r\n  specifying a maximum of N,\r\n  any passage appearing in more than N programs is treated as if it appeared in\r\n  a base file (i.e., it is never reported).  This option can be used to control\r\n  MOSS\' sensitivity.  With a maximum of 2, moss reports only passages that\r\n  appear in exactly two programs.  If one expects many very similar solutions\r\n  (e.g., the short first assignments typical of introductory programming\r\n  courses) then using a value of 3 or 4 is a good way to eliminate all but\r\n  truly unusual matches between programs while still being able to detect\r\n  3-way or 4-way plagiarism.  With a value of 1000000 (or any very\r\n large number), moss reports all matches, no matter how often they appear.t\0\nmaxmatchesx\0q\0~\0Gsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0typet\0namet\0descriptiont\0propertyuq\0~\0\0\0\0t\0250t\0integert\0Number of Matching Pairst\0¨This option specifies the number of matching pairs (students) to show in the\r\n  results.  The default is 250 (i.e., only the 250 highest-similarity pairs\r\n  will be shown).t\0pairsx\0q\0~\0Gsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0typet\0namet\0descriptiont\0propertyuq\0~\0\0\0\0t\0falset\0booleant\0Use Experimental Servert\0\—This option will send queries to the current experimental version of the\r\n  MOSS server. The experimental server has the most recent MOSS features and\r\n  is also usually less stable (read: may have more bugs).t\0experimentalx\0q\0~\0Gsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0typet\0namet\0descriptionuq\0~\0\0\0\0t\00t\0truet\0debugt\0integert\0Debug Levelt\0\ŸSet to a non-zero value for the script to produce debugging output (the\r\n  larger the number, the greater the detail, up to about 5).  Debugging output\r\n  on each grading script run will be e-mailed to the instructor.x\0q\0~\0Gxq\0~\0t\00x\0p',_binary '¨\Ì\0sr\0!org.webcat.core.MutableDictionary\0cB\Õ\Z2†\0Z\0\nhasChangedL\0parentt\0\"Lorg/webcat/core/MutableContainer;xr\0-er.extensions.foundation.ERXMutableDictionarypJ#S~\Î\Óî\0\0xr\0-com.webobjects.foundation.NSMutableDictionary\\\⁄92aF¯\0\0xr\0&com.webobjects.foundation.NSDictionary(\rº\ƒlXé\0[\0keyst\0[Ljava/lang/Object;[\0objectsq\0~\0xpur\0[Ljava.lang.Object;ê\ŒXüs)l\0\0xp\0\0\0t\0languaget\0pairst\0experimentalt\0debugt\0\nmaxmatc