pet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\03t\0\nhintsLimitt\0falset\0integert\0Hints Limitt\0OMaximum number of hints the student will receive from\n  failed reference tests.t\0Feedback Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0disablet\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\00t\0truet\0hideHintsWithint\0falset\0integert\0\"Hide Hints (Hints Blackout Period)t\0\„Suppress all hints from failed reference tests for submissions within this\n  many days of the deadline (set to zero for hints to always be visible). Currently\n  turns off extra feedback as well, since hints are not implemented.t\0Feedback Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0showExtraFeedbackt\0booleant\0Show Extra FeedbacktCurrently a synonym for \'Show Hints\': This will be repurposed after May 2009\n  to control whether to show specific information about failed tests.\n  Currently synonym for \'Show Hints\' so as not to break deployed assignments\n  that expect the option to be available and have that meaning.t\0Feedback Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0enableStudentTestst\0booleant\0#Student Unit Tests Enabled/Requiredt\0\ÁEnabling this option activates the student test option. That means that\n  students must submit their own tests. Disabled, this option supports non-TDD\n  testing using only instructor tests. Enabled, this activates student TDD mode.t\0Scoring Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0allStudentTestsMustPasst\0booleant\0All Student Tests Must PasstIf you are truly following test-driven development practices, then no code\n  is ever released until all of its unit tests pass. If this option is set to\n  true, students will not receive a non-zero score or receive further\n  assessment feedback unless all student tests pass. If this option is not\n  set, then students may continue to proceed even if some student-written\n  tests fail. The student\'s correctness/testing score is multiplied by the\n  proportion of their tests that pass. Should also set\n  \"Student Unit Tests Enabled/Required\".t\0Scoring Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0truet\0coverageMetrict\0booleant\0Measure Student Test Coveraget&This activates/deactivates student-written test coverage metrics. This is\n  currently running in a very simple mode that does methods + conditions and\n  decisions executed. To be meaningful, student unit test submission must be\n  active. Should also set\n  \"Student Unit Tests Enabled/Required\".t\0Scoring Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\00t\0truet\0debugt\0integert\0Debug Levelt\0\◊Set to a non-zero value for the script to produce debugging output (the\n  larger the number, the greater the detail, up to about 5).  Debugging output\n  on each grading script run will be e-mailed to the instructor.t\0Script Developerx\0q\0~\0Xxq\0~\0t\09t\00sq\0~\0-uq\0~\0\0\0\0t\0Scoring Settingst\0Feedback Settingst\0Python Settingst\0Script Developerx\0q\0~\0sq\0~\0-uq\0~\0\0\0\0t\0PerlForPluginsx\0q\0~\0t\0/http://web-cat.cs.vt.edu/WCWiki/PythonTddPlugint\012t\0 http://web-cat.cs.vt.edu/updatest\0400sq\0~\0-uq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0sizet\0propertyt\0typet\0namet\0descriptionuq\0~\0\0\0\0t\0pythont\020t\0	pythonCmdt\0	shortTextt\0\ZPython Interpreter Commandt¨The name of the python interpreter to use.  The default is \"python\".  On\n  systems with multiple python interpreters installed, you can use thi