leArray…øspª|\0\0xr\0!com.webobjects.foundation.NSArray\Àh©†\œ.Ö\Ã\0[\0objectsq\0~\0xpuq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0typet\0namet\0descriptiont\0propertyt\0	fileTypesuq\0~\0\0\0\0t\0	fileOrDirt\0\ZInstructor Reference TeststXPython unit tester[s] (file or directory of files) for testing the submitted\n  classes. If you select a directory, it should contain pyunit test\n  classes, all of which will be used. These should be ASCII \".py\" only, not\n  compiled \".pyc\" files. The required convention is that to test a module\n  named \"mod\", the tester be named \"modtests.py\".t\0instructorUnitTestsq\0~\0-uq\0~\0\0\0\0t\0pyx\0q\0~\03xq\0~\01sq\0~\0\0uq\0~\0\0\0\0t\0typet\0namet\0descriptiont\0propertyuq\0~\0\0\0\0t\0	fileOrDirt\0Data Files for Studentt≠A file (or a directory of files) to place in the student\'s current working\n  directory when running his/her tests and when running reference tests.  The\n  file you select (or the entire contents of the directory you select) will be\n  copied into the current working directory during grading so that\n  student-written and instructor-written test cases can read from and/or\n  write to the file(s).  The default is to copy no files.t\0\nlocalFilesx\0q\0~\01xq\0~\0t\0=http://web-cat.cs.vt.edu/WCWiki/PythonTddPlugin/ChangeHistoryt\0Virginia Tech Computer Sciencesq\0~\0-uq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0versiont\0nameuq\0~\0\0\0\0t\0\nPython 3.3t\0Pythonx\0q\0~\0Oxq\0~\0sq\0~\0-uq\0~\0\0\0\0	sq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0useJESt\0booleant\0\nUse Jythont\0≠Choose to use the plug-in\'s built-in Jython v2.2.1 distribution (from JES,\n  and including media computation support), rather than the server\'s native\n  python installation.t\0Python Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0	showHintst\0booleant\0\nShow HintstHints: Shows the students extra feedback from the scripts, such\n  as which tests passed and failed, as well as the assert messages from failed\n  tests. Choosing good messages, such as \'getX() does not return the correct\n  value\' is important. The default assert messages are something like\n  \'getX() != 2\', which is definitely not helpful and may encourage students to\n  hard-code values to pass the test.  Enabling hints is likely to be very useful\n  for beginning students, but might be counterproductive for more advanced\n  students.t\0Feedback Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0disablet\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\03t\0\nhintsLimitt\0falset\0integert\0Hints Limitt\0OMaximum number of hints the student will receive from\n  failed reference tests.t\0Feedback Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0disablet\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\00t\0truet\0hideHintsWithint\0falset\0integert\0\"Hide Hints (Hints Blackout Period)t\0\„Suppress all hints from failed reference tests for submissions within this\n  many days of the deadline (set to zero for hints to always be visible). Currently\n  turns off extra feedback as well, since hints are not implemented.t\0Feedback Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0showExtraFeedbackt\0booleant\0Show Extra FeedbacktCurrently a synonym for \'Show Hints\': This will be repurposed after May 2009\n  to control whether to show specific information about failed tests.\n  Currently synonym for \'Show Hints\' so as not to break deployed assignments\n  that expect the option to be available and have that meaning.t\0Feedback Settingsx\0q\0~\0Xsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0enable