o copy no files.t\0\nlocalFilesx\0q\0~\03xq\0~\0t\0:http://wiki.web-cat.org/WCWiki/JavaTddPlugin/ChangeHistorysq\0~\0/uq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0versiont\0nameuq\0~\0\0\0\0t\01.4t\0Javax\0q\0~\0_sq\0~\0\0uq\0~\0\0\0\0t\0versiont\0nameuq\0~\0\0\0\0t\01.5t\0Javax\0q\0~\0_sq\0~\0\0uq\0~\0\0\0\0t\0versiont\0nameuq\0~\0\0\0\0t\01.6t\0Javax\0q\0~\0_sq\0~\0\0uq\0~\0\0\0\0t\0versiont\0nameuq\0~\0\0\0\0t\01.7t\0Javax\0q\0~\0_sq\0~\0\0uq\0~\0\0\0\0t\0versiont\0nameuq\0~\0\0\0\0t\01.8t\0Javax\0q\0~\0_xq\0~\0sq\0~\0/uq\0~\0\0\0\0(sq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0\ruseAssertionst\0booleant\0Use Java Assertionst\0üEnable Java assertions during execution.  When set to false, assertions\n  in student or instructor-provided code will be treated as non-executable\n  (no-op\'s).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0\ruseDefaultJart\0booleant\0Use Built-in Jarst\0∑Set to true to have a set of built-in jars containing Virginia Tech\n  CS 1/CS 2 classes placed on the classpath for assignments.  Set to\n  false to omit these jars from the classpath.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0propertyt\0typet\0namet\0descriptiont\0	fileTypest\0categoryuq\0~\0\0\0\0t\0classpathJart\0	fileOrDirt\0Predefined Classest\ A jar file (or a directory of class files in subdirs reflecting their\n  package structure, or a directory of multiple jar files) containing\n  precompiled classes to add to the classpath when compiling and running\n  submissions.  Use this setting if you\'d like to share the same jar(s)\n  across several assignments.  If you have multiple jars to provide,\n  place them all in the same directory in your Web-CAT file space and\n  then select the whole directory.sq\0~\0/uq\0~\0\0\0\0t\0jarx\0q\0~\0§t\0Basic Settingsxq\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0useXvfbt\0booleant\0!Enable Xvfb During Test Executiont\ƒThis option is necessary for running GUI software tests on Linux servers.\n  It uses an instance of Xvfb, the X virtual frame buffer server, to run\n  unit tests so that GUI tests can render to a live X server.  Note that\n  enabling this option will slow down test execution, since it takes time to\n  start up an X server, but it is required for GUI testing on a linux\n  server.  Also, this option requires that Xvfb is already installed on\n  the server.t\0Advanced Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0	fileTypest\0categoryuq\0~\0\0\0\0t\0truet\0\npolicyFilet\0filet\0Java Security PolicytA Java security policy file used to limit actions on student programs at\n  run-time.  Leave unset to use the built-in default, which plugs most\n  security holes and prevents any file system access outside the subtree\n  rooted at the program\'s working directory.sq\0~\0/uq\0~\0\0\0\0t\0policyx\0q\0~\0\ƒt\0Advanced Settingsxq\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0truet\0remote.post.urlt\0	shortTextt\0Remotely Post SubmissionstZA URL to which submissions will be posted as they are processed, to\n  allow for external tools to receive student submissions.  If a URL is\n  specified an HTML POST request will be sent to the given URL, with the\n  student\'s user name provided in the parameter \'user\', and the student\'s\n  submission file provided in the parameter \'uploadedfile\'.t\0Advanced Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0truet\0grader.partnerExcludePatternst\0	shortTextt\0Partner Name Exclude Patternst®The plug-in will automatically scan <b>@author</b> tags in source code\n  to try to identify the user names of partners when partners are allowed\n  on an assignment.  Here, you can provide a comma-separated list of names\n  to exclude from consideration (e.g., the names of instructors, if some\n  instructor names are listed in @author lines in pre-provided code).\n  Full Perl-style regular expressions can be used if desired.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0allStudentTestsMustPasst\0booleant\0All Student Tests Must Passt\ÁIf you are truly following test-driven development practices, then no code\n  is ever released until all of its unit tests pass.  If this option is set to\n  true, students will not receive a non-zero score or receive further\n  assessment feedback unless all student tests pass.  If this option is not\n  set, then students may continue to proceed even if some student-written\n  tests fail  The student\'s correctness/testing score is multiplied by the\n  proportion of their tests that pass.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0studentsMustSubmitTestst\0booleant\0\ZStudents Must Submit Testst\ÂWhen set, this option requires all students to submit test cases for their\n  own code.  Submissions without test cases will received feedback to that\n  effect (and no more), as well as a zero score.  If you unset this option,\n  then student submissions will <b>not</b> be required to include\n  student-written test cases, and <b>only</b> the reference test pass rate\n  will be used for scoring (i.e., student code coverage and student test pass\n  rate will not be included in scoring).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0choicest\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\00t\0truesq\0~\0/uq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0valuet\0labeluq\0~\0\0\0\0t\00t\0Methods executedx\0q\0~$sq\0~\0\0uq\0~\0\0\0\0t\0valuet\0labeluq\0~\0\0\0\0t\01t\0Lines executedx\0q\0~$sq\0~\0\0uq\0~\0\0\0\0t\0valuet\0labeluq\0~\0\0\0\0t\02t\0Methods + conditions executedx\0q\0~$sq\0~\0\0uq\0~\0\0\0\0t\0valuet\0labeluq\0~\0\0\0\0t\03t\0Lines + conditions executedx\0q\0~$sq\0~\0\0uq\0~\0\0\0\0t\0valuet\0labeluq\0~\0\0\0\0t\04t\0%Methods + lines + conditions executedx\0q\0~$xq\0~t\0coverageMetrict\0radioChoicet\0Test Coverage Metrict\0~Choose the criterion used to measure how thoroughly\n                           a student\'s tests cover the corresponding code.t\0Basic Settingsxq\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0typet\0namet\0descriptiont\0propertyt\0categoryuq\0~\0\0\0\0t\0doublet\0Test Coverage Goalt¿If students are required to submit tests, this value is the target test\n  coverage threshold that must be achieved in order for students to receive\n  full credit.  It should be a number between 0.0-100.0 representing the\n  minimum percent coverage required for full credit.  The default is 100.0,\n  but a lower value may be used to allow students some slack in test coverage\n  when JaCoCo test coverage measures make achieving 100% too challenging.t\0coverageGoalt\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0includeTestSuitesInCoveraget\0booleant\0.Include Student Test Code in Coverage Measurest{Normally, this plug-in excludes student-written tests from all coverage\n  calculations, since the goal of the testing is to test the solution, not\n  to execute more tests.  When this option is set, student-written tests\n  will be included in code coverage measures for the purposes of scoring,\n  meaning that students will have to execute all of the code in their\n  test classes.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0requireSimpleExceptionCoveraget\0booleant\0\'Require Coverage of Simple Catch Blockst¥When set, this option requires students to test all catch blocks, including\n  simple try/catch statements that are provided purely for compiler compliance\n  and that simply print a stack trace or re-throw the exception.  If unchecked,\n  catch blocks that contain only a statement to print the stack trace or\n  re-throw a wrapped version of the exception are not counted in\n  coverage measurements, and do not result in point deductions.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0!requireSimpleGetterSetterCoveraget\0booleant\0.Require Coverage of Simple Getters and Setterst\’When set, this option requires students to test all simple getter and\n  setter methods.  A simple getter is a method whose name starts with\n  \"get\", and whose body simply returns a field value.  A simple setter is\n  a void method whose name starts with \"set\" accepting one parameter, and\n  whose body simply assigns that parameter to a field.  If unchecked,\n  simple getters and setters are not counted in coverage measurements, and\n  do not result in point deductions.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0*test *testst\0studentTestIncludet\0	shortTextt\0Students Test Class PatternstSpecify the Java class names that should be treated as JUnit-style\n  test cases.  Only student classes with names that match the patterns you\n  list here will be executed as test cases.  Patterns are case-insensitive.\n  Use * as a wildcard character (ANT-style pattern matching is used).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0\rabstract* *$*t\0studentTestExcludet\0	shortTextt\0&Students Test Class Exclusion Patternst•Specify Java class names that should <b>not</b> be treated as JUnit-style\n  test cases.  Any classes that match the \"Student Test Class Patterns\"\n  above and <em>also</em> match the patterns you list here\n  will not be treated as executable test cases.    Patterns are\n  case-insensitive.  Use * as a wildcard character (ANT-style pattern matching\n  is used).  Use \"none\" if you do not wish to use any exclusion patterns.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0*t\0refTestIncludet\0	shortTextt\0Reference Test Class Patternst\‹Specify the Java class names that should be treated as JUnit-style\n  test cases when selected as reference tests by an instructor.  This\n  setting is only relevant when an instructor selects an entire directory\n  or folder of Java classes.  In that case, only instructor reference classes\n  with names that match the patterns you list here will be executed as test\n  cases.  Patterns are case-insensitive.  Use * as a wildcard character\n  (ANT-style pattern matching is used).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0\rabstract* *$*t\0refTestExcludet\0	shortTextt\0\'Reference Test Class Exclusion PatternstSpecify Java class names that should <b>not</b> be treated as JUnit-style\n  test cases when selected as reference tests by an instructor.  This\n  setting is only relevant when an instructor selects an entire directory or\n  folder of Java classes.  In that case, any classes that match the\n  \"Reference Test Class Patterns\" above and <em>also</em> match the\n  patterns you list here will not be treated as executable test cases.\n  Patterns are case-insensitive.  Use * as a wildcard character (ANT-style\n  pattern matching is used).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\05student.testingsupport.junit4.AdaptiveTimeout.ceilingt\0integert\0$Default Test Case Time Limit (in ms)t´This plug-in provides built-in adaptive detection and termination of\n  infinite loops that occur within individual test methods.  This setting\n  controls the default timeout before a single test case method is judged as\n  \"taking too long\", although this amount will be gradually increased up\n  to a higher maximum value if test methods terminate but come close to\n  this limit.  The default if unset is ten seconds (10000 ms).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\05student.testingsupport.junit4.AdaptiveTimeout.maximumt\0integert\0&Default Test Case Maximum Time (in ms)t\'This plug-in provides built-in adaptive detection and termination of\n  infinite loops that occur within individual test methods.  This setting\n  controls the maximum allowable timeout before a single test case is judged\n  as \"taking too long\".  The default if unset is twenty seconds (20000 ms).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0typet\0namet\0descriptiont\0propertyt\0categoryuq\0~\0\0\0\0t\0\nantBooleant\0Turn Checkstyle Offt\0sDisable Checkstyle for static analysis entirely (no need to upload a\n  separate configuration file to turn it off).t\0disableCheckstylet\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0	fileTypest\0categoryuq\0~\0\0\0\0t\0truet\0checkstyleConfigt\0filet\0Checkstyle Configurationt1An XML file containing a Checkstyle rule configuration (see the\n  <a href=\"http://checkstyle.sourceforge.net/\" target=\"_new\">Checksyle\n  documentation</a>).  This plug-in uses Checkstyle v5.6.  If you would\n  like to turn off all Checkstyle checks entirely, use the \"Turn\n  Checkstyle Off\" option instead.sq\0~\0/uq\0~\0\0\0\0t\0xmlx\0q\0~˜t\0Basic Settingsxq\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0typet\0namet\0descriptiont\0propertyt\0categoryuq\0~\0\0\0\0t\0\nantBooleant\0Turn PMD Offt\0lDisable PMD for static analysis entirely (no need to upload a\n  separate configuration file to turn it off).t\0\ndisablePmdt\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0	fileTypest\0categoryuq\0~\0\0\0\0t\0truet\0	pmdConfigt\0filet\0PMD ConfigurationtAn XML file containing a set of PMD rules (see the\n  <a href=\"http://pmd.sourceforge.net/\" target=\"_new\">PMD\n  documentation</a>).  This plug-in uses PMD v5.0.5.  If you owuld like to\n  turn off all PMD checks entirely, use the \"Turn PMD Off\" options instead.sq\0~\0/uq\0~\0\0\0\0t\0xmlx\0q\0~t\0Basic Settingsxq\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0typet\0namet\0descriptiont\0propertyt\0categoryuq\0~\0\0\0\0t\0\nantBooleant\0Run COMTOR Comment Analyzert\0pSet to true to run the COMTOR Comment Analyzer and include the results\n  as part of the overall feedback report.t\0\nuse.comtort\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0*t\0staticAnalysisIncludet\0	shortTextt\0Classes to Analyzet1Specify the Java class names that should be included in Checkstyle and\n  PMD analysis.  Only student classes with names that match the patterns you\n  list here will be processed by Checkstyle and PMD.  Patterns are\n  case-insensitive.  Use * as a wildcard character (ANT-style pattern\n  matching is used).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0sizet\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\040t\0nonet\0staticAnalysisExcludet\0	shortTextt\0 Classes to Exclude from AnalysistôSpecify Java class names that should <b>not</b> be processed by\n  Checkstyle or PMD.  Any classes that match the \"Classes to Analyze\"\n  above and <em>also</em> match the patterns you list here\n  will not be processed by Checkstyle or PMD.    Patterns are\n  case-insensitive.  Use * as a wildcard character (ANT-style pattern\n  matching is used).  Use \"none\" if you do not wish to use any\n  exclusion patterns.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0	fileTypest\0categoryuq\0~\0\0\0\0t\0truet\0markupPropertiest\0filet\0Static Analysis Scoring Schemet\∆A Java properties file containing the point deductions and limits to\n  use for messages generated by Checkstyle or PMD.  The point deductions\n  are specified in a fairly generic way so they can be used for many\n  assignments.  Deductions in the default scheme are typically 1, 2, or 5\n  \'points\', which are really simply relative weights.  Specify a scaling\n  factor below to adjust how these weights are translated into point\n  deductions for a student.sq\0~\0/uq\0~\0\0\0\0t\0\npropertiesx\0q\0~Yt\0Basic Settingsxq\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0toolDeductionScaleFactort\0doublet\0(Static Analysis Deduction Scaling FactortÄThe <b>Static Analysis Scoring Scheme</b> above defines the point deductions\n  and limits to use for messages generated by Checkstyle or PMD in a generic\n  way, with most deductions in the default scheme being 1, 2, or 5 points.\n  Deductions in the static analysis scoring scheme are multiplied by this\n  factor to translate them into actual \'point deductions\' shown to the\n  student.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\03t\0\nhintsLimitt\0integert\0Hints Limitt\0OMaximum number of hints the student will receive from failed reference\n  tests.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0typet\0namet\0descriptiont\0propertyt\0categoryuq\0~\0\0\0\0t\0doublet\0Minimum Test Coverage for HintstIf students are required to submit tests, this value is a minimum test\n  coverage threshold that must be achieved in order for any hints to be\n  given.  It should be a number between 0.0-100.0 representing the minimum\n  percent coverage required to see hints.t\0minCoverageLevelt\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0junitErrorsHideHintst\0booleant\0$Clean JUnit Tests Required for HintstJIf students are required to submit tests, this option requires all test\n  case classes to be free of PMD-based JUnit style errors, such as failing\n  to include at least one test method in each test case class, failing\n  to include assert*() calls in each test case method, or using \"bogus\"\n  assertions such as assertEquals(1, 1).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\00t\0truet\0hideHintsWithint\0integert\0!Hide Hints X Days Before Deadlinet*Suppress all hints from failed reference tests for submissions within this\n  many days of the deadline (set to zero for hints to always be visible).\n  This setting allows the instructor to \"hide\" hints close to the assignment\n  deadline in an attempt to encourage students to start working earlier.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\00t\0truet\0showHintsWithint\0integert\0!Show Hints X Days Before Deadlinet\0˜Show hints (up to the <i>Hints Limit</i>) from failed reference tests for\n  submissions within this many days of the deadline (only useful when <i>Hide\n  Hints X Days Before Deadline</i> is non-zero, to restore hints as the\n  deadline approaches).t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0wantPDFt\0booleant\0Generate PDF PrintoutstïSet to true if you wish for a single PDF file containing a pretty-printed\n  source code printout to be generated from the student\'s code.  The printout\n  will be downloadable by students, and accessible by TAs during grading.\n  <b>Note:</b>  This option uses both <code>enscript</code> and\n  <code>ps2pdf</code> as external commands, and requires these programs to\n  be correctly installed and configured.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0wantClassDiagramst\0booleant\0Generate Class DiagramstÅSet to true if you wish to generate class diagrams from students\' code.\n  The diagrams will be viewable by students, and accessible by TAs during\n  grading.  <b>Note:</b>  This option uses both <code>doxygen</code> and\n  <code>dot</code> as external commands, and requires these programs to\n  be correctly installed and configured in the JavaTddPlugin\'s global\n  configuration options.t\0Basic Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\00t\0truet\0debugt\0integert\0Debug Levelt\0\◊Set to a non-zero value for the script to produce debugging output (the\n  larger the number, the greater the detail, up to about 5).  Debugging output\n  on each grading script run will be e-mailed to the instructor.t\0Developer Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0doNotDeletet\0\nantBooleant\0Preserve Derived FilestoSet to true to prevent the plug-in from deleting the derived files it\n  creates during the build/test process for each submission.  Normally, these\n  files are deleted when a given submission has been completely processed.\n  This setting is provided for debugging purposes, when one wishes to\n  inspect the intermediate test driver source code or other derived files.t\0Developer Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0truet\0generateHeatmapst\0\nantBooleant\0Generate Bug Heatmapst\0≤Set to true to generate GZoltar-based defect heatmaps.  This option is\n  <b>experimental</b> and for research use only.  Using it will slow down\n  generation of student feedback.t\0Developer Settingsx\0q\0~\0Ñsq\0~\0\0uq\0~\0\0\0\0t\0defaultt\0advancedt\0propertyt\0typet\0namet\0descriptiont\0categoryuq\0~\0\0\0\0t\0falset\0truet\0useEnhancedFeedbackt\0booleant\0$Use Enhanced Feedback (Experimental)t\0CSet to true to use the new (experimental) enhanced feedback layout.t\0Developer Settingsx\0q\0~\0Ñxq\0~\0t\01t\0truet\04sq\0~\0/uq\0~\0\0\0\0t\0Basic Settingst\0Advanced Settingst\0Developer Settingsx\0q\0~\0sq\0~\0/uq\0~\0\0\0\0t\0\rANTForPluginst\0PerlForPluginst\0\rPMDForPluginst\0CheckstyleForPluginsx\0q\0~\0t\0,http://wiki.web-cat.org/WCWiki/JavaTddPlugint\0Virginia Tech Computer Sciencet\0\Zhttp://web-cat.org/updatest\0400sq\0~\0/uq\0~\0\0\0\0sq\0~\0\0uq\0~\0\0\0\0t\0sizet\0typet\0namet\0descriptiont\0propertyuq\0~\0\0\0\0t\040t\0	shortTextt\0Doxygen Directoryt\‹The directory on the local server that contains the Doxygen executable.\n  Doxygen (and Dot, below) are used to generate class diagrams for the code\n  that students submit; if you do not have a copy of Doxygen or wish to\n  disable diagram generation across all assignments, you can leave this\n  field blank. If you are not the user administering this Web-CAT server,\n  you will need to have your system administrator install this tool and set\n  this path if you wish to use it.t\0\ndoxygenDirx\0q\0~8sq\0~\0\0uq\0~\0\